webpackJsonp([82738739147053],{755:function(n,r){n.exports={data:{markdownRemark:{frontmatter:{title:"МАЛО",type:"lyrics"},html:"<h1>МАЛО</h1>\n<section>\n<p>Ой, как мне воздуха мало — <br>\nпью я воздух пиалой,<br>\nпью и не могу напиться — <br>\nвоздух я клюю птицей.</p>\n<p>Ой, как земли‐то мне мало — <br>\nем я землю стаканом,<br>\nем и не могу наесться — <br>\nс нею я съедаю детство.</p>\n<p>Ой, как огня‐то мне мало — <br>\nлью огонь в себя алый,<br>\nлью и подливаю масла<br>\nи пою огнём астру.</p>\n<p>Ой, как воды‐то мне мало — <br>\nсколько вод утекало,<br>\nстолько был тогда сухой<br>\nполыхающей травой.</p>\n<p>Мгла за глаза легла,<br>\nневесть куда звала,<br>\nневестою звалась,<br>\nлаяла и вилась.</p>\n<p>Я за глазами свил<br>\nиз веток и светил<br>\nгнёзда, и в них птенцы<br>\nвоском клювов жгут венцы.</p>\n</section>"}},pathContext:{path:"/en/lyrics/malo/",langKey:"en"}}}});
